window.bookSummaryJSON = "<p><b>Kaiden Jericho is taking another test.</b></p> <p>This time it's with his friends, but something is amiss.</p> <p>Not everything is at it seems, and no one has found Gin Sonny...yet.</p> <p>Gin must test himself against any and all who beat him. He needs a new device to track down and help destroy one of the victims who got away.</p> <p>Will anyone realize that Gin hasn't left Earth? Will Kaiden understand what is different about this test he is undergoing?</p> <p>This time, the \"test\" has real-world consequences.</p> <p>You don't become the best of the best by staying alive. In the Animus, you are closer to perfection with each death you suffer.</p> <p>Kaiden Jericho would rather skip the death part, thank you very much.</p> <p><i>Includes special note from co-author Michael Anderle.</i></p>"; 
